<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8"/>
    <title>辽事通</title>
</head>
<body onload=getD1() style="margin: 0;font-family: -apple-system,BlinkMacSystemFont,Segoe UI,Roboto,Hiragino Sans GB,Microsoft YaHei UI,Microsoft YaHei,Source Han Sans CN,sans-serif,Apple Color Emoji,Segoe UI Emoji,Segoe UI Symbol">
<div style="width: 1170px;height: 2532px;position: relative;">
    <div class="name">*金朋</div>
    <div class="number">2101********0312</div>
    <div id="datetime" class="now"></div>
    <div id="resultTime" class="result"></div>

    <div style="width: 1170px;height: 2532px;">
        <img src="data:image/png;base64," alt="图片Base64编码"
             width="1170" height="2532"/>
    </div>
</div>
<script>
    getD2();

    function  getD1(){
        var date = new Date();
        var sign2 = ":";
        var year = date.getFullYear() // 年
        var month = date.getMonth() + 1; // 月
        var day = date.getDate(); // 日
        var hour = date.getHours(); // 时
        var minutes = date.getMinutes(); // 分
        var seconds = date.getSeconds() //秒
        // 给一位数的数据前面加 “0”
        if (month >= 1 && month <= 9) {
            month = "0" + month;
        }
        if (day >= 0 && day <= 9) {
            day = "0" + day;
        }
        if (hour >= 0 && hour <= 9) {
            hour = "0" + hour;
        }
        if (minutes >= 0 && minutes <= 9) {
            minutes = "0" + minutes;
        }
        if (seconds >= 0 && seconds <= 9) {
            seconds = "0" + seconds;
        }
        document.getElementById("datetime").innerHTML = year + "-" + month + "-" + day + " " + hour + sign2 + minutes + sign2 + seconds;
    }

    function  getD2(){
        var date = new Date();
        var year = date.getFullYear() // 年
        var month = date.getMonth() + 1; // 月
        var day = date.getDate(); // 日
        if (day >= 0 && day <= 9) {
            day = "0" + day;
        }
        if (month >= 1 && month <= 9) {
            month = "0" + month;
        }

        document.getElementById("resultTime").innerHTML = year + "-" + month + "-" + day + " " + "01:25:19";
    }

    setInterval("getD1();",1000);
</script>
</body>
<style scope>
    .name {
        position: absolute;
        left: 307px;
        top: 501px;
        font-style: normal;
        font-weight: 500;
        font-size: 47px;
        color: #333333;
    }
    .number {
        position: absolute;
        left: 307px;
        top: 571px;
        font-style: normal;
        font-weight: 400;
        font-size: 40px;
        letter-spacing: 0.02em;
        color: #666666;
    }
    .now {
        position: absolute;
        width: 1170px;
        text-align: center;
        top: 834px;
        font-style: normal;
        font-weight: 500;
        font-size: 42px;
        color: #00C84A;
    }

    .result {
        position: absolute;
        right: 123px;
        top: 2274px;
        font-style: normal;
        font-weight: 400;
        font-size: 42px;
        line-height: 59px;
        color: #666666;
    }
</style>
</html>
